import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import Button from "../components/Button";
import "./Option1.css";
// import FormFieldLabel from "./FormFieldLabel";

const Option1 = () => {
  const navigate = useNavigate();

  const onFormContainerClick = useCallback(() => {
    navigate("/administrater-login");
  }, [navigate]);

  const onFormContainerClick1 = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onFormContainerClick2 = useCallback(() => {
    navigate("/student-login");
  }, [navigate]);

  return (
    <div className="option">
      <div className="option-inner">
        <div className="xl-parent">
          <h1 className="xl6">STUDENT PORTAL</h1>
          <div className="frame-wrapper">
            <div className="frame-parent">
              <div className="form-parent">
                <div className="form" onClick={onFormContainerClick}>
                  <Button
                    children="Administrator"
                    propFontSize="24px"
                    propDisplay="unset"
                    propMinWidth="unset"
                    rightIcon="/lefticon.svg"
                    buttonPosition="unset"
                    buttonTop="unset"
                    buttonLeft="unset"
                    buttonBorder="unset"
                    buttonFlex="1"
                  />
                </div>
                <div className="form" onClick={onFormContainerClick1}>
                  <Button
                    children="College"
                    propFontSize="24px"
                    propDisplay="inline-block"
                    propMinWidth="90px"
                    rightIcon="/lefticon1.svg"
                    buttonPosition="unset"
                    buttonTop="unset"
                    buttonLeft="unset"
                    buttonBorder="unset"
                    buttonFlex="1"
                  />
                </div>
              </div>
              <div className="form2" onClick={onFormContainerClick2}>
                <Button
                  children="Studdent"
                  propFontSize="24px"
                  propDisplay="unset"
                  propMinWidth="unset"
                  rightIcon="/lefticon.svg"
                  buttonPosition="unset"
                  buttonTop="unset"
                  buttonLeft="unset"
                  buttonBorder="unset"
                  buttonFlex="unset"
                />
              </div>
            </div>
          </div>
        </div>
      </div>
      <main className="right18">
        <section className="right-child">
          <div className="instance-item" />
        </section>
        <section className="right-item" />
      </main>
    </div>
  );
};

export default Option1;
